const db_items = $('Select rows from a table').all().map(item => item.json.news_url);

var RSS_items = $('Parse RSS Feed').all();

items = RSS_items.filter(i =>
  !db_items.includes(i.json.guid.toLowerCase().trim())
);

if (!items.length) return [];

// Filter articles with content > 300 chars AND having an image
const filtered = items.filter(item => 
    (item.json.contentSnippet || '').length > 300 && 
    item.json.link && item.json.link
);

if (!filtered.length) return [];

// Sort by isoDate descending (most recent first)
filtered.sort((a, b) => new Date(b.json.isoDate) - new Date(a.json.isoDate));
const mostRecent = filtered[0].json;

// Use the enclosure image
const images = [mostRecent.enclosure.url];

// Return single article
return [{
  json: {
    title: mostRecent.title,
    link: mostRecent.guid,
    pubDate: mostRecent.isoDate,
    content: mostRecent.contentSnippet,
    images: images
  }
}];

