const items = $input.all();

const sanitizedItems = items.map(item => {
    const newItem = { ...item };

    function sanitizeText(text) {
        if (!text) return text;

        // Decode common HTML entities for quotes
        text = text.replace(/&#8216;|&lsquo;/g, ""); // left single quote
        text = text.replace(/&#8217;|&rsquo;/g, ""); // right single quote
        text = text.replace(/&#8220;|&ldquo;/g, ""); // left double quote
        text = text.replace(/&#8221;|&rdquo;/g, ""); // right double quote
        text = text.replace(/&quot;/g, "");          // double quote

        // Remove straight, curly, and escaped quotes
        text = text.replace(/["]|\\\"|\\'/g, "");

        // Remove all types of line breaks (actual, escaped, unicode)
        text = text.replace(/(\r\n|\n|\r|\u2028|\u2029)/g, " "); // actual newlines
        text = text.replace(/\\r\\n|\\n|\\r/g, " ");             // escaped newlines

        // Remove all special characters except letters, numbers, basic punctuation
        text = text.replace(/[^a-zA-Z0-9 .,'!?;:()-]/g, " ");

        // Reduce multiple spaces to a single space
        text = text.replace(/\s+/g, " ");

        // Trim leading/trailing spaces
        return text.trim();
    }
    function removeBeforeColonIfSure(text) {
    if (text.toLowerCase().includes("sure")) {
        const colonIndex = text.indexOf(":");
        if (colonIndex !== -1) {
            return text.slice(colonIndex + 1).trim();
        }
    }
    return text;
}
    if (newItem.json.output) {
        newItem.json.output = sanitizeText(newItem.json.output);
      newItem.json.output = newItem.json.output.replace("Sure, here is the summary you requested:","");

      newItem.json.output = removeBeforeColonIfSure(newItem.json.output);
    }

    return newItem;
});

return sanitizedItems;

